window.bookSummaryJSON = "<p>Rife with hostile cultures and outright enemies, the Unknown Regions hold many perils for Luke Skywalker and the Jedi, who are searching for Zonama Sekot - the living planet that may hold the key to dealing once and for all with the Yuuzhan Vong.</p> <p>Meanwhile, on the edge of the galaxy and in the heart of a trusted ally, old enemies are stirring. The Yuuzhan Vong have inflamed long-forgotten vendettas that are even now building up to crisis point. And as Han and Leia journey on a quest to knit the unraveling galaxy back together, betrayal and deception await them.</p>"; 
